// import logo from './logo.svg';
import './App.css';
import './custom.scss'
import { Container } from 'react-bootstrap';
import NavBar from './components/navbar/Navbar';

import { BrowserRouter, Route, Routes} from "react-router-dom";
import Login from './components/login_register/login';
import Logout from './components/login_register/logout';
import Home from './components/home/homepage';
import Edit from './components/home/editpage';


import UserProvider from './context/userloggedIn';


import 'bootstrap/dist/css/bootstrap.min.css';




function App() {

  const baseurl = 'http://localhost:8000/api/'

  // const [fetching, setfetching] = useState(false);

  // const [data, setdata] = useState([])

  // const load = async (url) => {
  //     setfetching(true);
  //     await fetch(url, {
  //       Method: 'GET',
  //       Body: {},
  //     })
  //       .then(res => res.json()).then(res => {
  //         setdata(res)
  //         // console.log(res)
  //       })
  //       .catch(err => {
  //         console.log(err);
  //     })
  //     setfetching(false);
  //   }

  // useEffect(() => {

  //   load(baseurl+'all/?format=json');
  // },[])


  return (
    <BrowserRouter>
      <UserProvider>
      <div className="App">

            <NavBar />
            <Container className='body align-items-center'>

            <Routes>
              <Route index element={<Home url={baseurl} />} />
              <Route path='login' element={<Login url={baseurl}/> } />
              <Route path='logout' element={<Logout url={baseurl}/> } />
              <Route path=':homenum' element={<Home url={baseurl}/>} />
              <Route path=':homenum/:roomnum' element={<Home url={baseurl}/>} />
              <Route path=':hid/edit' element={<Edit url={baseurl}/>} />
              <Route path=':hid/:rid/edit' element={<Edit url={baseurl}/>} />
              <Route path=':hid/:rid/:lid/edit' element={<Edit url={baseurl}/>} />

            </Routes>
          </Container>

        </div>
        </UserProvider>
        </BrowserRouter>
  );
}

export default App;
